import React, { Component, useEffect } from "react";
import './professor-marvin.css';
import UploadService from "./services/upload-files.service";

export default class ProfessorMarvin extends Component {
    constructor(props) {
        super(props);    
        this.state = {
          selectedFiles: undefined,
          currentFile: undefined,
          progress: 0,
          delay: 0,
          messages: [],
          user_message: 'Type a message...'
        };

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
        this.bottomRef = React.createRef();
        this.executeScroll = () => this.bottomRef.current.scrollIntoView();
      }

    delay = ms => new Promise(res => setTimeout(res, ms));

    componentDidMount = async () => {
        UploadService.getMessages().then((message_list) => {
          this.setState({
            messages: message_list.data['messages'],
          });
        });
        await this.delay(50);
        this.executeScroll();
    }

    clearMessages = async () => {
      await UploadService.clearMessages()
        .then((response) => {
          this.setState({
            message: response.message,
          });
          return UploadService.getMessages();
        })
        .then((message_list) => {
          this.setState({
            messages: message_list.data['messages'],
          });
        })
        .catch(() => {
          this.setState({
            message: "ERROR: Unable to delete all messages",
          });
        });
    }

    handleChange(event) {
      this.setState({user_message: event.target.value});
    }

    handleSubmit = async (event) => {
      await UploadService.sendMessage(this.state.user_message)
      .then((response) => {
        return UploadService.getMessages();
      })
      .then((message_list) => {
        console.log(message_list);
        console.log(message_list.data);
        this.setState({
          messages: message_list.data['messages'],
        });
      })
      .catch(() => {
        console.log('FAILED');
        this.setState({
          message: "ERROR: Unable to delete all messages",
        });
      });

      var getValue= document.getElementById("message-field");
      if (getValue.value !== "") {
          getValue.value = "";
          this.setState({user_message: ""});
      }
      this.executeScroll();
    }



    render() {    
        const { messages } = this.state;
        return (
          <div>

            <aside>
              <div className="card message-box">
                <table className="table-border">
                  <thead className="header">
                    <tr><td colSpan="3" >&nbsp;&nbsp;&nbsp;Professor Marvin</td></tr>
                  </thead>
                  <tbody className="body">
                    {messages.map((currMessage) => (
                        (currMessage.message.message_type === "0") ?
                          <tr><td><div className="placeholder"></div></td><td><div className="box-user">{currMessage.message.content}</div></td></tr>
                        :
                          (currMessage.message.message_type === "1") ?
                            <tr><td><div className="box-marvin">{currMessage.message.content}</div></td><td><div className="placeholder"></div></td></tr>
                          :
                            <tr><td><div className="placeholder">{currMessage.message.content}</div></td><td><div className="placeholder">{currMessage.message.content}</div></td></tr>
                    ))}
                  </tbody>
                </table>
                <div ref={this.bottomRef}/>
              </div>
            </aside>

            <aside>
              <div>
                <form className="messages-input-div">
                  <input onChange={this.handleChange} placeholder="Type a message..."  id="message-field" className="messages-input-field" type="text"/>‚Äç
                  <button onClick={this.handleSubmit} className="messages-input-button">Send!</button>
                  <button onClick={this.clearMessages} className="btn btn-clear" disabled={this.state.messages.length === 0} >Clear</button>
                </form>
              </div>
            </aside>


            <aside>
              <br></br>
              <a href="/upload_page">
                <button 
                  className="btn btn-go-to-upload">
                  &lt; Edit Files
                </button>
              </a>
            </aside>
          </div>
        );
    }    
}
